В прошлом году у меня все было супер быстро и стремительно. 
Много городов и перелетов, много проектов и дэдлайнов на работе. Старалась на выходных изо всех сил отдохнуть (читай максимально забыть про работу) чтобы вдохнуть и помчаться в новую неделю.
А теперь я интересуюсь slow living. Удивительно, но мне это нравится. Хоть и делаю первые попытки, пробую, привыкаю, наблюдаю: 

🍁Стараюсь слушать себя. Если хочется отдохнуть - расслабляюсь,  гуляю, читаю или уделяю время уходу за собой 

🍁Приоретизирую дела. Выделяю несколько задач  по работе и личных в неделю 

🍁Кайфую от мелочей. Пинаю желуди, например 😆

🍁Учусь создавать ритуалы: готовить обед, делать упражнения для спины по вечерам, а после медитировать

🍁Стараюсь обходиться меньшим - не покупать некачественные вещи, одежду, предметы быта

Пока полет нормальный, нравится. Ощущаю больше спокойствия и уюта

