Here we feature the Homare Junmai Ginjo Karahashi Black Label which is enjoyable both chilled and warm. Made from Yamadanishiki rice, this IWC 2017 Trophy sake from Fukushima Prefecture is a dry, medium weight style, with notes of candy floss, grains and pear. Round, savory mid-palate having some positive bitter minerality, this goes well with greasy rich meals! Recommend to drink at 12-15 degrees chilled or at 40 degrees warm. All Homare sakes are also available at 10% off this September as part of our featured brewery of the month. No promo code needed! 🍶

